import React from 'react';
import { 
  Box, 
  Typography, 
  TextField, 
  Slider, 
  Grid,
  InputAdornment
} from '@mui/material';

/**
 * Input Panel Component
 * Handles user inputs for the simulation
 */
const InputPanel = ({ inputs, onInputChange }) => {
  // Handle numeric input changes with validation
  const handleNumericChange = (name, value, min, max) => {
    // Parse value as number
    const numValue = parseFloat(value);

    // Validate number is within range
    if (!isNaN(numValue) && (min === undefined || numValue >= min) && (max === undefined || numValue <= max)) {
      onInputChange(name, numValue);
    }
  };

  return (
    <Box>
      <Typography variant="h6" gutterBottom>
        Simulation Parameters
      </Typography>

      {/* Product Dimensions */}
      <Box sx={{ mb: 3 }}>
        <Typography variant="subtitle2" gutterBottom>
          Product Dimensions
        </Typography>
        <Grid container spacing={2}>
          <Grid item xs={6}>
            <TextField
              label="Short Edge"
              type="number"
              value={inputs.shortEdge}
              onChange={(e) => handleNumericChange('shortEdge', e.target.value, 10, 305)}
              InputProps={{
                endAdornment: <InputAdornment position="end">mm</InputAdornment>,
              }}
              inputProps={{ min: 10, max: 305 }}
              fullWidth
              margin="dense"
              helperText="Range: 10-305mm"
            />
          </Grid>
          <Grid item xs={6}>
            <TextField
              label="Long Edge"
              type="number"
              value={inputs.longEdge}
              onChange={(e) => handleNumericChange('longEdge', e.target.value, 10, 458)}
              InputProps={{
                endAdornment: <InputAdornment position="end">mm</InputAdornment>,
              }}
              inputProps={{ min: 10, max: 458 }}
              fullWidth
              margin="dense"
              helperText="Range: 10-458mm"
            />
          </Grid>
        </Grid>
      </Box>

      {/* Price Inputs */}
      <Box sx={{ mb: 3 }}>
        <Typography variant="subtitle2" gutterBottom>
          Price Parameters
        </Typography>
        <Grid container spacing={2}>
          <Grid item xs={12}>
            <TextField
              label="Sales Price per Unit"
              type="number"
              value={inputs.salesPricePerUnit}
              onChange={(e) => handleNumericChange('salesPricePerUnit', e.target.value, 0)}
              InputProps={{
                startAdornment: <InputAdornment position="start">JPY</InputAdornment>,
              }}
              fullWidth
              margin="dense"
            />
          </Grid>
          <Grid item xs={12}>
            <TextField
              label="Material Cost per Unit"
              type="number"
              value={inputs.materialCostPerUnit}
              onChange={(e) => handleNumericChange('materialCostPerUnit', e.target.value, 0)}
              InputProps={{
                startAdornment: <InputAdornment position="start">JPY</InputAdornment>,
              }}
              fullWidth
              margin="dense"
            />
          </Grid>
          <Grid item xs={12}>
            <TextField
              label="Labor Cost per Hour"
              type="number"
              value={inputs.laborCostPerHour}
              onChange={(e) => handleNumericChange('laborCostPerHour', e.target.value, 0)}
              InputProps={{
                startAdornment: <InputAdornment position="start">JPY</InputAdornment>,
              }}
              fullWidth
              margin="dense"
            />
          </Grid>
          <Grid item xs={12}>
            <TextField
              label="Ink Price"
              type="number"
              value={inputs.inkPricePerCC}
              onChange={(e) => handleNumericChange('inkPricePerCC', e.target.value, 0)}
              InputProps={{
                startAdornment: <InputAdornment position="start">JPY</InputAdornment>,
                endAdornment: <InputAdornment position="end">/cc</InputAdornment>,
              }}
              fullWidth
              margin="dense"
            />
          </Grid>
        </Grid>
      </Box>

      {/* Sales Volume Slider */}
      <Box sx={{ mb: 3 }}>
        <Typography variant="subtitle2" gutterBottom>
          Monthly Sales Volume
        </Typography>
        <Grid container spacing={2} alignItems="center">
          <Grid item xs={9}>
            <Slider
              value={inputs.monthlySalesVolume}
              onChange={(_, value) => onInputChange('monthlySalesVolume', value)}
              min={0}
              max={1000}
              step={10}
            />
          </Grid>
          <Grid item xs={3}>
            <TextField
              value={inputs.monthlySalesVolume}
              onChange={(e) => handleNumericChange('monthlySalesVolume', e.target.value, 0, 1000)}
              inputProps={{ min: 0, max: 1000 }}
              type="number"
              size="small"
            />
          </Grid>
        </Grid>
        <Typography variant="caption" color="text.secondary">
          Units per month (0-1000)
        </Typography>
      </Box>

      {/* Additional information */}
      <Box sx={{ mt: 4 }}>
        <Typography variant="caption" display="block" color="text.secondary">
          * All calculations are based on the Roland DG MO-180 UV printer specifications.
        </Typography>
        <Typography variant="caption" display="block" color="text.secondary">
          * Initial investment cost: 3,780,000 JPY
        </Typography>
        <Typography variant="caption" display="block" color="text.secondary">
          * Print speed: 6 prints/hour
        </Typography>
        <Typography variant="caption" display="block" color="text.secondary">
          * Printable area: 305mm x 458mm
        </Typography>
      </Box>
    </Box>
  );
};

export default InputPanel;
